import React from 'react';
import Avatar from '@material-ui/core/Avatar';
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import TextField from '@material-ui/core/TextField';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import Link from '@material-ui/core/Link';
import Grid from '@material-ui/core/Grid';
import Box from '@material-ui/core/Box';
import AssignmentIcon from '@material-ui/icons/Assignment';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import TextInpunts from "../components/textInput";
import Custom_Button from "../components/button";
import FormconrrllCheckbox from "../components/formcontrollcheckbox";
import RadioForcontroll from "../components/radioformcontrol";
import Card from '@material-ui/core/Card';

import {useStyles_testU} from '../design/styles';


function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {'Copyright © '}
      <Link color="inherit" href="https://material-ui.com/">
        Your Website
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

export default function SignIn() {
  const classes = useStyles_testU();

  return (
    <Container component="main" maxWidth="sm">
       <Card className={classes.root} style={{padding: 18}}>
      <CssBaseline />
      <div className={classes.paper}>
      <Avatar className={classes.avatar} style={{backgroundColor:'#357a38'}}>
          <AssignmentIcon />
        </Avatar>
        <Typography component="h1" variant="h5" >
        <span style={{color:'#121858', fontWeight: 'bold'}}> Student Data Form</span>  
        </Typography>

        <form className={classes.form}>
          <TextInpunts
           id="fname"
           text={"First Name"}
           name="fname" 
           />
          <TextInpunts
           id="lname"
           text={"Last Name"}
           name="lname" 
           />
          <TextInpunts
            id="email"
            text={"Email Address"}
            name="email"
            autoComplete="email"
            autoFocus
          />
          <TextInpunts
            id="mobile"
            text={"Mobile Number"}
            name="mobile"
            autoComplete="mobile"
            autoFocus
          />
          <TextInpunts
            name="password"
            text="Password"
            type="password"
            id="password"
            autoComplete="current-password"
          />
          <FormconrrllCheckbox  val={"hiiiii"} labeltext={"English"}/>
          <RadioForcontroll />
          <Custom_Button type={'submit'} name={"Submit"} onClick={()=>{alert('HI')}} />
        </form>
      </div>
      </Card>
    </Container>
  );
}
